import APIHandler from "./APIHandler.js";

class APITravelPlan extends APIHandler {
  async generateRoute(_idStart, _idDest) {
    try {
      const data = await this.getRequest(
        "http://54.146.196.79:8080/dp1/api/airport/flight/route/generateRoute?idStart=" +
          _idStart +
          "&idObjective=" +
          _idDest
      );
      return data;
    } catch (error) {
      console.error(error);
    }
  }
}
export default APICountry;
